import React from 'react';

import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { fetchImages } from '../../actions/imageActions';

class Gallery extends React.Component {
  constructor(props) {
    super(props);
  }

  renderImages() {
    if (!this.props.pictures || this.props.pictures.count == 0) {
      return <div className="no-images">There are no images to display!</div>
    } else {
      return this.props.images.map((url) => {
        return <img className="picture" href={url} />
      })
    }
  }

  render() {
    //const { pictures } = this.state;
    return (
      <div className="gallery">
        hello world
      </div>
    );
  }
}

function mapStateToProps(state) {
  const { images, batchId, page } = this.state.imageState;
  return {
    images: images,
    batchId: batchId,
    page: page
  }
}

export default connect(mapStateToProps)(Gallery);
